import React, { useEffect, useState } from "react";
import Layout from "../components/Layout";
import Box from "@mui/material/Box";
import { teamData } from "../service/Api";
import { Typography } from "@mui/material";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Grid from "@mui/material/Grid";

const About = () => {
  const [teams, setTeams] = useState([]);

  const imgUrl = "https://restapinodejs.onrender.com";

  const getTeamData = async () => {
    const response = await teamData();
    setTeams(response?.data?.TeamMember);
    // console.log('team', teams);
  };

  useEffect(() => {
    getTeamData();
  }, []);

  return (
    <>
      <Layout title={"PhoenixTech-About"}>
        <Box sx={{ width: "100%", color: "#D4D4D4", height: "50vh" }}>
          <Typography
            variant="h5"
            sx={{
              textAlign: "center",
              p: 3,
              color: "black",
              fontWeight: "bold",
            }}
          >
            OUR TEAMS
          </Typography>
          
          {teams?.map((element, index) => {
            return (
              <>
                <Grid item xs={3}>
                  <Card sx={{ maxWidth: 345 }}>
                    <CardMedia
                      sx={{ height: 140 }}
                      image="/static/images/cards/contemplative-reptile.jpg"
                      title="green iguana"
                    />
                    <CardContent>
                      <Typography gutterBottom variant="h5" component="div">
                        Lizard
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        Lizards are a widespread group of squamate reptiles,
                        with over 6,000 species, ranging across all continents
                        except Antarctica
                      </Typography>
                    </CardContent>
                  </Card>
                </Grid>
              </>
            );
          })}
        </Box>
      </Layout>
    </>
  );
};

export default About;
